import React, { useState } from 'react';
import { AppBar, Toolbar, Typography, makeStyles, Tooltip } from '@material-ui/core';
import FavoriteBorderIcon from '@material-ui/icons/FavoriteBorder';
import Container from '@material-ui/core/Container';
import Button from '@material-ui/core/Button';
import Link from 'next/link'
import { useRouter } from 'next/router';
import Badge from '@material-ui/core/Badge';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
    textDecoration: 'none',
    paddingTop: 15
  },
  appBar: {
    background: '#16ABF8',
  }
}));

const Header: React.FC = (props) => {
  const classes = useStyles();
  const history = useRouter()

  const [anchorEl, setAnchorEl] = useState(null);
  // eslint-disable-next-line @typescript-eslint/no-unused-vars
  const open = Boolean(anchorEl);

  const handleMenu = (event) => {
    setAnchorEl(event.currentTarget);
    history.push('/favorite')
  };

  const isEmpty = (data) => Object.values(data).length === 0

  return (
    <AppBar position="static" color="transparent" className={classes.appBar}>
      <Toolbar>
        <Container maxWidth="sm">
          <Link href="/">
            <a className={classes.title}>
              <Typography variant="h3">
                <b>Up.</b>
              </Typography>
            </a>
          </Link>

          <div>
            <Tooltip title="Favorite">
              <Button
                onClick={handleMenu}
                color="inherit"
                style={{ textTransform: 'capitalize' }}
              >
                Click
              {/* <Badge 
                badgeContent={usersData.users.favorites.length} 
                invisible={isEmpty(usersData.users.favorites)} 
                color="secondary" 
                variant="dot"
              >
                <FavoriteBorderIcon />
                <Typography
                  variant="subtitle1"
                  component="span"
                  style={{ paddingLeft: 5 }}
                >
                  My Favorite
              </Typography>
              </Badge> */}
              </Button>
            </Tooltip>
          </div>
        </Container>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
